import React from "react";
import { styled } from "styled-components";

const Wrapper = styled.section`
  background-color: pink;
  height: 100vh;
`;
const WorkContent = styled.div`
  > h2 {
    text-align: center;
    border-bottom: 1px solid black;
  }
`;
const Website = styled.div``;
const App = styled.div``;
const Practice = styled.div``;

const Work = () => {
  return (
    <Wrapper>
      <WorkContent>
        <h2>Work</h2>
        <Website>
          <h3>website</h3>
          <p>仮想サイトの制作</p>
          <p>01</p>
          <p>02</p>
        </Website>
        <App>
          <h3>app</h3>
          <p>Reactを用いたアプリの制作</p>
          <p>01</p>
        </App>
        <Practice>
          <h3>practice</h3>
          <p>その他、模写コーディングなど</p>
        </Practice>
      </WorkContent>
    </Wrapper>
  );
};

export default Work;
